#ifdef EIGHT_BITS_PROCESSOR
unsigned int decode(unsigned char* out, unsigned char* in, unsigned int size){
  unsigned int i_in, i_out;
  unsigned char value, count;

  i_out = 0; /* points to the first position of output vector */

  for(i_in = 0; i_in < size; i_in++){
    value = i_in & 0x01 ? 0x01 : 0x00; /* checks if the output vector position's
    is even or odd*/

    for(count = in[i_in]; count > 0; count--){
      out[i_out++] = value; /*expand the representation in "count" times*/
    }
  }

  return i_out;
}
#endif

#ifdef SIXTEEN_BITS_PROCESSOR
unsigned int decode(unsigned char* out, unsigned int* in, unsigned int size){
  unsigned int i_in, i_out, count;
  unsigned char value;

  i_out = 0; /* points to the first position of output vector */

  for(i_in = 0; i_in < size; i_in++){
    value = i_in & 0x01 ? 0x01 : 0x00; /* checks if the output vector position's
    is even or odd*/

    for(count = in[i_in]; count > 0; count--){
      out[i_out++] = value; /*expand the representation in "count" times*/
    }
  }

  return i_out;
}
#endif

